import React from "react";
import Wrapper from "../sections/Wrapper";
import avatarImage from "../assets/profile.avif";
import { FaBento, FaGithub, FaLinkedin } from "react-icons/fa";

function About() {
  return (
    <div className="profile">
      <img src={avatarImage} alt="" className="profile-image" />
      <h1 className="profile-text">Bonjour, je suis Nathan</h1>
      <h2 className="profile-text">Le créateur de ce superbe pokedex</h2>
      <h4 className="profile-text">
      Ce projet a été créé pour m'améliorer en React.js
      </h4>
      <div className="profile-links">
        <a href="https://github.com/YOUGBOY95">
          <FaGithub />
        </a>
        <a href="https://www.youtube.com/c/KishanSheth21">
          <FaYoutube />
        </a>
        <a href="https://www.linkedin.com/in/nathan-pinard-/">
          <FaLinkedin />
        </a>
      </div>
    </div>
  );
}

export default Wrapper(About);
